import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with increased timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded', timeout: 60000 });

    // Wait for page to fully load
    await page.waitForLoadState('networkidle');
    await page.waitForSelector('body');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on account dropdown
    await page.waitForSelector('.account-lists', { timeout: 10000 });
    await page.hover('.account-lists');

    // Wait for dropdown to appear and click profile link
    await page.waitForSelector('.dropdown-content', { state: 'visible' });
    await page.click('.dropdown-content a:has-text("Your Profile")');

    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 10000 });
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    // Extract profile data
    const profileData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return null;

      return {
        fullName: profileHeader.querySelector('h2')?.innerText,
        username: profileHeader.querySelector('.username')?.innerText,
        bio: profileHeader.querySelector('.bio')?.innerText,
        orders: profileHeader.querySelectorAll('.stat')[0]?.querySelector('.stat-number')?.innerText,
        reviews: profileHeader.querySelectorAll('.stat')[1]?.querySelector('.stat-number')?.innerText,
        sellerRating: profileHeader.querySelectorAll('.stat')[2]?.querySelector('.stat-number')?.innerText
      };
    });

    if (!profileData) {
      throw new Error('Failed to extract profile data');
    }

    return {
      success: true,
      action: "Navigated to Jun's Profile and extracted profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take error screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
